import React from "react";
// import { useState } from "react";
import { Link } from "react-router-dom";
import "./Home.css";
// import img from "../images/425-500.jpg";
import image3201 from "../images/320.jpg"
import image3202 from "../images/320-2.jpg"
import image3203 from "../images/320-3.jpg"
// import image3751 from "../images/375.jpg"
// import image3752 from "../images/375-2.jpg"
// import image3753 from "../images/375-3.jpg"
// import image4251 from "../images/425.jpg"
// import image4252 from "../images/425-3.jpg"
// import image4253 from "../images/425-3.jpg"
import img2 from "../images/lucas-5tRmLGguL3Q-unsplash.jpg";
import logo from "../images/Logo.png";
// import hamburger from "../images/hamburger.png";
<link
  rel="stylesheet"
  href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"
></link>;

function Home() {
  // const [media , setMedia] = useState("")
  var onresize = function (e) {
    //note i need to pass the event as an argument to the function
    //  const screen = e.target.outerWidth;
    // let height = e.target.outerHeight;
    // console.log(width ,"width")
    // console.log(height ,"height")
  };
  window.addEventListener("resize", onresize);
  const words = ["CSS3.", "HTML5.", "javascript."];
  let i = 0;

  
  function typingEffect() {
    let word = words[i].split("");
   
    var loopTyping = function() {
      let timer;
      if (word.length > 0) {
        document.getElementById('word').innerHTML += word.shift();
      } else {
        deletingEffect();
        return false;
      };
      timer = setTimeout(loopTyping, 500);
     
    };
    loopTyping();
  };
  
  function deletingEffect() {
    let word = words[i].split("");
    var loopDeleting = function() {
     let timer;
      if (word.length > 0) {
        word.pop();
        document.getElementById('word').innerHTML = word.join("");
      } else {
        if (words.length > (i + 1)) {
          i++;
        } else {
          i = 0;
        };
        typingEffect();
        return false;
      };
      timer = setTimeout(loopDeleting, 200);
    };
    loopDeleting();
  };
  
  typingEffect();
  return (
    <div>
      <div>
        <header>
          <nav class="navbarlaptop">
            <img class="Logo" src={logo} alt=""></img>
            <div class="divlinks">
              <ul class="ullinks">
                <li class="Link1">
                  <Link class="Links" to="/">
                    Home
                  </Link>
                </li>
                <li class="Link2">
                  <Link class="Links" to="/aboutus">
                    About us
                  </Link>
                </li>
                <li class="Link3">
                  <Link class="Links" to="/contactus">
                    Contact us
                  </Link>
                </li>
              </ul>
            </div>
          </nav>
        </header>
        <div class="imagecontainermobile">
          <img src={image3201} alt="Avatar" class="imagemobile320" />
          <img src={image3202} alt="Avatar" class="imagemobile320" />
          <img src={image3203} alt="Avatar" class="imagemobile320" />
        </div>
        <div class="imagecontainerlaptop">
          <div class="box1">
            <img src={img2} alt="Avatar" class="imagelaptop1" />
            <div class="box1content1">
              <h1>are you student</h1>
            </div>
          </div>
          <div class="box2">
            <img src={img2} alt="Avatar" class="imagelaptop1" />
            <div class="box2content2">
              <h1>are you student</h1>
            </div>
          </div>
          <div class="box3">
            <img src={img2} alt="Avatar" class="imagelaptop1" />
            <div class="box3content3">
              <h1>are you student</h1>
            </div>
          </div>
        </div>
        <div class="flex">
	<p class="header-sub-title" id="word"></p><p class="header-sub-title blink">|</p>
</div>

<p>lets chat on twitter <a href="https://twitter.com/haaswillian">@haaswillian</a></p>
      </div>
    </div>
  );
}

export default Home;
